script: |
  super -f text -I q468.spq | sort > q468.out

inputs:
  - name: q468.spq
    data: |
      SELECT ALL - + col2 + + 48 * - col1 * + col0 / - - col1, 37 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 84 + 32 + col2 + 17 NOT BETWEEN + col0 AND NULL;
  - name: tab1

outputs:
  - name: q468.out
    data: |
